          <div class="linked-heading_container__iwdxj">
            <h2 class="text_wrapper__i87JK linked-heading_header__YpMmf headings_heading__DRlSP" data-version="v1"
              data-components-heading="true"
              style="--text-color: var(--ds-gray-1000); --text-size: 2rem; --text-line-height: 2.5rem; --text-letter-spacing: -0.049375rem; --text-weight: 600;">
              <span class="linked-heading_target__xscdv linked-heading_offsetTop__uAoyO"
                id="iterate-quickly-while-building-your-product"></span><a
                class="linked-heading_title__mCMLh [&amp;>p]:m-0"
                href="#iterate-quickly-while-building-your-product">Iterate quickly while building your product</a><span
                class="linked-heading_permalink__pJ_q_"><svg class="text-[0.6em]" data-testid="geist-icon" height="16"
                  stroke-linejoin="round" viewBox="0 0 16 16" width="16" style="color: currentcolor;">
                  <path fill-rule="evenodd" clip-rule="evenodd"
                    d="M8.46968 1.46968C10.1433 -0.203925 12.8567 -0.203923 14.5303 1.46968C16.2039 3.14329 16.2039 5.85674 14.5303 7.53034L12.0303 10.0303L10.9697 8.96968L13.4697 6.46968C14.5575 5.38186 14.5575 3.61816 13.4697 2.53034C12.3819 1.44252 10.6182 1.44252 9.53034 2.53034L7.03034 5.03034L5.96968 3.96968L8.46968 1.46968ZM11.5303 5.53034L5.53034 11.5303L4.46968 10.4697L10.4697 4.46968L11.5303 5.53034ZM1.46968 14.5303C3.14329 16.2039 5.85673 16.204 7.53034 14.5303L10.0303 12.0303L8.96968 10.9697L6.46968 13.4697C5.38186 14.5575 3.61816 14.5575 2.53034 13.4697C1.44252 12.3819 1.44252 10.6182 2.53034 9.53034L5.03034 7.03034L3.96968 5.96968L1.46968 8.46968C-0.203923 10.1433 -0.203925 12.8567 1.46968 14.5303Z"
                    fill="currentColor"></path>
                </svg></span></h2>
          </div>
          <p>The first version of your product isn't perfect, so you need to iterate and try things.</p>
          <p>You can ask v0 to make updates for you, or if you prefer, export the code to your editor and start building
            locally. When you've finished adding your new feature, you want to test and make sure it works correctly on
            different browsers and devices <em>before</em> you update your live application.</p>
          <p>Vercel integrates with tools like GitHub where you can save snapshots of your codebase for every change.
            For example, let's say you send your latest code changes to GitHub in a pull request. Vercel automatically
            creates a new URL from your changes and sends you a link to review before merging.</p>
          <div class="linked-heading_container__iwdxj">
            <h3 class="text_wrapper__i87JK linked-heading_header__YpMmf headings_heading__DRlSP" data-version="v1"
              data-components-heading="true"
              style="--text-color: var(--ds-gray-1000); --text-size: 1.5rem; --text-line-height: 2rem; --text-letter-spacing: -0.029375rem; --text-weight: 600;">
              <span class="linked-heading_target__xscdv linked-heading_offsetTop__uAoyO"
                id="infrastructure-from-your-code"></span><a class="linked-heading_title__mCMLh [&amp;>p]:m-0"
                href="#infrastructure-from-your-code">Infrastructure from your code</a><span
                class="linked-heading_permalink__pJ_q_"><svg class="text-[0.6em]" data-testid="geist-icon" height="16"
                  stroke-linejoin="round" viewBox="0 0 16 16" width="16" style="color: currentcolor;">
                  <path fill-rule="evenodd" clip-rule="evenodd"
                    d="M8.46968 1.46968C10.1433 -0.203925 12.8567 -0.203923 14.5303 1.46968C16.2039 3.14329 16.2039 5.85674 14.5303 7.53034L12.0303 10.0303L10.9697 8.96968L13.4697 6.46968C14.5575 5.38186 14.5575 3.61816 13.4697 2.53034C12.3819 1.44252 10.6182 1.44252 9.53034 2.53034L7.03034 5.03034L5.96968 3.96968L8.46968 1.46968ZM11.5303 5.53034L5.53034 11.5303L4.46968 10.4697L10.4697 4.46968L11.5303 5.53034ZM1.46968 14.5303C3.14329 16.2039 5.85673 16.204 7.53034 14.5303L10.0303 12.0303L8.96968 10.9697L6.46968 13.4697C5.38186 14.5575 3.61816 14.5575 2.53034 13.4697C1.44252 12.3819 1.44252 10.6182 2.53034 9.53034L5.03034 7.03034L3.96968 5.96968L1.46968 8.46968C-0.203923 10.1433 -0.203925 12.8567 1.46968 14.5303Z"
                    fill="currentColor"></path>
                </svg></span></h3>
          </div>
          <p>How did that URL get created? Vercel took care of all the infrastructure automation for you:</p>
          <ul
            class="my-3 ml-6 list-none p-0 [&amp;>li]:before:absolute [&amp;>li]:before:-ml-3.5 [&amp;>li]:before:inline-block [&amp;>li]:before:text-[var(--accents-4)] [&amp;>li]:before:content-['–']">
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0">It
              examined your code to understand what tools you're working with</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0">It
              installed the necessary dependencies into a temporary, secure sandbox</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0">It
              ran compute to build your application from these dependencies</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0">It
              took the build output and generated the cloud infrastructure needed to run your app</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0">It
              assigned and secured a domain so you can access your app through a URL</li>
          </ul>
          <p>This is all happening inside of an automatically generated <em>preview</em> environment on Vercel — a place
            where you can safely iterate and make changes without affecting your application. For example, you might
            want to connect to a different database to prevent changing your live data.</p>
          <p>If your application works correctly and you're happy with the changes, you can merge this new feature into
            your main codebase. Once again, Vercel will automatically create and build a new URL for you, in a separate
            <em>production</em> environment.</p>
          <p>Just like that, your application is now live and updated around the world. Make a mistake? Don't sweat it —
            you can instantly go back to your previous version in a few clicks.</p>
          <div class="linked-heading_container__iwdxj">
            <h2 class="text_wrapper__i87JK linked-heading_header__YpMmf headings_heading__DRlSP" data-version="v1"
              data-components-heading="true"
              style="--text-color: var(--ds-gray-1000); --text-size: 2rem; --text-line-height: 2.5rem; --text-letter-spacing: -0.049375rem; --text-weight: 600;">
              <span class="linked-heading_target__xscdv linked-heading_offsetTop__uAoyO"
                id="use-your-favorite-developer-tools"></span><a class="linked-heading_title__mCMLh [&amp;>p]:m-0"
                href="#use-your-favorite-developer-tools">Use your favorite developer tools</a><span
                class="linked-heading_permalink__pJ_q_"><svg class="text-[0.6em]" data-testid="geist-icon" height="16"
                  stroke-linejoin="round" viewBox="0 0 16 16" width="16" style="color: currentcolor;">
                  <path fill-rule="evenodd" clip-rule="evenodd"
                    d="M8.46968 1.46968C10.1433 -0.203925 12.8567 -0.203923 14.5303 1.46968C16.2039 3.14329 16.2039 5.85674 14.5303 7.53034L12.0303 10.0303L10.9697 8.96968L13.4697 6.46968C14.5575 5.38186 14.5575 3.61816 13.4697 2.53034C12.3819 1.44252 10.6182 1.44252 9.53034 2.53034L7.03034 5.03034L5.96968 3.96968L8.46968 1.46968ZM11.5303 5.53034L5.53034 11.5303L4.46968 10.4697L10.4697 4.46968L11.5303 5.53034ZM1.46968 14.5303C3.14329 16.2039 5.85673 16.204 7.53034 14.5303L10.0303 12.0303L8.96968 10.9697L6.46968 13.4697C5.38186 14.5575 3.61816 14.5575 2.53034 13.4697C1.44252 12.3819 1.44252 10.6182 2.53034 9.53034L5.03034 7.03034L3.96968 5.96968L1.46968 8.46968C-0.203923 10.1433 -0.203925 12.8567 1.46968 14.5303Z"
                    fill="currentColor"></path>
                </svg></span></h2>
          </div>
          <p>Vercel helps your build any way your prefer, whether that is a handful of HTML files or a powerful
            JavaScript framework. While you don't <em>need</em> to use a framework, these abstractions can help you
            build better products.</p>
          <p>Frameworks include components and optimizations to help improve your <a
              href="https://vercel.com/blog/how-core-web-vitals-affect-seo" rel="noopener" target="_blank"
              data-zone="null" class="link_link__hbWKh link_blend__JjXMT">Core Web Vitals</a>, which is how search
            engines determine the speed and quality of your application. Your vitals affect your page ranking in search
            results, so it's important to pay attention and optimize them.</p>
          <p>Frameworks also simplify how you build common patterns, like routing between pages or fetching and
            displaying data from a database. Vercel supports over 30 different frameworks with zero-configuration.</p>
          <p>We are the creators and maintainers of <a href="https://nextjs.org" rel="noopener" target="_blank"
              data-zone="null" class="link_link__hbWKh link_blend__JjXMT">Next.js</a>, a framework for building React
            applications. We also help fund the full-time development of <a href="https://svelte.dev" rel="noopener"
              target="_blank" data-zone="null" class="link_link__hbWKh link_blend__JjXMT">Svelte</a>, as well as support
            other open-source frameworks.</p>
