          <div class="linked-heading_container__iwdxj">
            <h2 class="text_wrapper__i87JK linked-heading_header__YpMmf headings_heading__DRlSP" data-version="v1"
              data-components-heading="true"
              style="--text-color: var(--ds-gray-1000); --text-size: 2rem; --text-line-height: 2.5rem; --text-letter-spacing: -0.049375rem; --text-weight: 600;">
              <span class="linked-heading_target__xscdv linked-heading_offsetTop__uAoyO"
                id="stay-fast-and-secure"></span><a class="linked-heading_title__mCMLh [&amp;>p]:m-0"
                href="#stay-fast-and-secure">Stay fast and secure</a><span class="linked-heading_permalink__pJ_q_"><svg
                  class="text-[0.6em]" data-testid="geist-icon" height="16" stroke-linejoin="round" viewBox="0 0 16 16"
                  width="16" style="color: currentcolor;">
                  <path fill-rule="evenodd" clip-rule="evenodd"
                    d="M8.46968 1.46968C10.1433 -0.203925 12.8567 -0.203923 14.5303 1.46968C16.2039 3.14329 16.2039 5.85674 14.5303 7.53034L12.0303 10.0303L10.9697 8.96968L13.4697 6.46968C14.5575 5.38186 14.5575 3.61816 13.4697 2.53034C12.3819 1.44252 10.6182 1.44252 9.53034 2.53034L7.03034 5.03034L5.96968 3.96968L8.46968 1.46968ZM11.5303 5.53034L5.53034 11.5303L4.46968 10.4697L10.4697 4.46968L11.5303 5.53034ZM1.46968 14.5303C3.14329 16.2039 5.85673 16.204 7.53034 14.5303L10.0303 12.0303L8.96968 10.9697L6.46968 13.4697C5.38186 14.5575 3.61816 14.5575 2.53034 13.4697C1.44252 12.3819 1.44252 10.6182 2.53034 9.53034L5.03034 7.03034L3.96968 5.96968L1.46968 8.46968C-0.203923 10.1433 -0.203925 12.8567 1.46968 14.5303Z"
                    fill="currentColor"></path>
                </svg></span></h2>
          </div>
          <p>Vercel's developer platform understands the tools and frameworks you're using. This enables us to optimize
            and secure your application automatically in ways that are normally difficult and time consuming.</p>
          <p>Instead of manually writing code to define your application infrastructure, Vercel can automatically
            convert the output from your framework into infrastructure. For example, we manage:</p>
          <ul
            class="my-3 ml-6 list-none p-0 [&amp;>li]:before:absolute [&amp;>li]:before:-ml-3.5 [&amp;>li]:before:inline-block [&amp;>li]:before:text-[var(--accents-4)] [&amp;>li]:before:content-['–']">
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/edge-network"><span
                  class="strong_docsString__rhKq5">Networking</span></a>: We help make your application fast globally
            </li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/domains"><span
                  class="strong_docsString__rhKq5">Domains</span></a>: We can manage your domains, including DNS, SSL
              certificates, and nameservers</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/storage"><span
                  class="strong_docsString__rhKq5">Storage</span></a>: We offer cache and object storage, as well as
              first-party database integrations</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/functions"><span
                  class="strong_docsString__rhKq5">Compute</span></a>: We provide an autoscaling, distributed, and
              secure compute platform</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/deployments/builds"><span
                  class="strong_docsString__rhKq5">CI/CD</span></a>: We automatically deploy your application as you
              push to your git repository</li>
          </ul>
          <div class="linked-heading_container__iwdxj">
            <h3 class="text_wrapper__i87JK linked-heading_header__YpMmf headings_heading__DRlSP" data-version="v1"
              data-components-heading="true"
              style="--text-color: var(--ds-gray-1000); --text-size: 1.5rem; --text-line-height: 2rem; --text-letter-spacing: -0.029375rem; --text-weight: 600;">
              <span class="linked-heading_target__xscdv linked-heading_offsetTop__uAoyO" id="observability"></span><a
                class="linked-heading_title__mCMLh [&amp;>p]:m-0" href="#observability">Observability</a><span
                class="linked-heading_permalink__pJ_q_"><svg class="text-[0.6em]" data-testid="geist-icon" height="16"
                  stroke-linejoin="round" viewBox="0 0 16 16" width="16" style="color: currentcolor;">
                  <path fill-rule="evenodd" clip-rule="evenodd"
                    d="M8.46968 1.46968C10.1433 -0.203925 12.8567 -0.203923 14.5303 1.46968C16.2039 3.14329 16.2039 5.85674 14.5303 7.53034L12.0303 10.0303L10.9697 8.96968L13.4697 6.46968C14.5575 5.38186 14.5575 3.61816 13.4697 2.53034C12.3819 1.44252 10.6182 1.44252 9.53034 2.53034L7.03034 5.03034L5.96968 3.96968L8.46968 1.46968ZM11.5303 5.53034L5.53034 11.5303L4.46968 10.4697L10.4697 4.46968L11.5303 5.53034ZM1.46968 14.5303C3.14329 16.2039 5.85673 16.204 7.53034 14.5303L10.0303 12.0303L8.96968 10.9697L6.46968 13.4697C5.38186 14.5575 3.61816 14.5575 2.53034 13.4697C1.44252 12.3819 1.44252 10.6182 2.53034 9.53034L5.03034 7.03034L3.96968 5.96968L1.46968 8.46968C-0.203923 10.1433 -0.203925 12.8567 1.46968 14.5303Z"
                    fill="currentColor"></path>
                </svg></span></h3>
          </div>
          <p>After shipping your application, you need to understand how it's performing in production. Vercel includes
            tools to help you view logs and traces, measure performance, and analyze traffic.</p>
          <ul
            class="my-3 ml-6 list-none p-0 [&amp;>li]:before:absolute [&amp;>li]:before:-ml-3.5 [&amp;>li]:before:inline-block [&amp;>li]:before:text-[var(--accents-4)] [&amp;>li]:before:content-['–']">
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/runtime-logs"><span
                  class="strong_docsString__rhKq5">Logging</span></a>: We allow you to view, search, and filter
              build/runtime logs to investigate issues and monitor your application.</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/otel"><span
                  class="strong_docsString__rhKq5">Tracing</span></a>: We support integrations with tracing tools like
              OpenTelemetry for deeper performance analysis.</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/analytics"><span
                  class="strong_docsString__rhKq5">Analytics</span></a>: We support first-party, privacy-friendly
              analytics for understanding how users interact with your application.</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/observability"><span
                  class="strong_docsString__rhKq5">Metrics</span></a>: We display and support querying of performance
              metrics like request counts, error rates, and API latencies.</li>
          </ul>
          <p>We also integrate with other observability tools and support draining logs to any service.</p>
          <div class="linked-heading_container__iwdxj">
            <h3 class="text_wrapper__i87JK linked-heading_header__YpMmf headings_heading__DRlSP" data-version="v1"
              data-components-heading="true"
              style="--text-color: var(--ds-gray-1000); --text-size: 1.5rem; --text-line-height: 2rem; --text-letter-spacing: -0.029375rem; --text-weight: 600;">
              <span class="linked-heading_target__xscdv linked-heading_offsetTop__uAoyO" id="security"></span><a
                class="linked-heading_title__mCMLh [&amp;>p]:m-0" href="#security">Security</a><span
                class="linked-heading_permalink__pJ_q_"><svg class="text-[0.6em]" data-testid="geist-icon" height="16"
                  stroke-linejoin="round" viewBox="0 0 16 16" width="16" style="color: currentcolor;">
                  <path fill-rule="evenodd" clip-rule="evenodd"
                    d="M8.46968 1.46968C10.1433 -0.203925 12.8567 -0.203923 14.5303 1.46968C16.2039 3.14329 16.2039 5.85674 14.5303 7.53034L12.0303 10.0303L10.9697 8.96968L13.4697 6.46968C14.5575 5.38186 14.5575 3.61816 13.4697 2.53034C12.3819 1.44252 10.6182 1.44252 9.53034 2.53034L7.03034 5.03034L5.96968 3.96968L8.46968 1.46968ZM11.5303 5.53034L5.53034 11.5303L4.46968 10.4697L10.4697 4.46968L11.5303 5.53034ZM1.46968 14.5303C3.14329 16.2039 5.85673 16.204 7.53034 14.5303L10.0303 12.0303L8.96968 10.9697L6.46968 13.4697C5.38186 14.5575 3.61816 14.5575 2.53034 13.4697C1.44252 12.3819 1.44252 10.6182 2.53034 9.53034L5.03034 7.03034L3.96968 5.96968L1.46968 8.46968C-0.203923 10.1433 -0.203925 12.8567 1.46968 14.5303Z"
                    fill="currentColor"></path>
                </svg></span></h3>
          </div>
          <p>Vercel helps protect your web application and prevent unwanted traffic.</p>
          <ul
            class="my-3 ml-6 list-none p-0 [&amp;>li]:before:absolute [&amp;>li]:before:-ml-3.5 [&amp;>li]:before:inline-block [&amp;>li]:before:text-[var(--accents-4)] [&amp;>li]:before:content-['–']">
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/vercel-firewall"><span
                  class="strong_docsString__rhKq5">Platform Firewall</span></a>: We automatically block malicious
              requests and unwanted bots before they reach your application.</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/security/ddos-mitigation"><span
                  class="strong_docsString__rhKq5">DDoS Protection</span></a>: We protect your application from traffic
              spikes caused by Distributed Denial of Service (DDoS) attacks.</li>
            <li class="mb-[10px] leading-[var(--line-height-primary)] text-[var(--font-size-primary)] [&amp;>p]:m-0"><a
                data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/security/vercel-waf"><span
                  class="strong_docsString__rhKq5">Web Application Firewall</span></a>: We allow you to define custom
              rules to protect from common attacks, web scrapers, and other unwanted traffic.</li>
          </ul>
          <p>We are compliant with SOC 2 Type 2, ISO 27001:2013, GDPR, PCI DSS, HIPAA, and other acronyms your security
            team asks about.</p>
          <div class="linked-heading_container__iwdxj">
            <h3 class="text_wrapper__i87JK linked-heading_header__YpMmf headings_heading__DRlSP" data-version="v1"
              data-components-heading="true"
              style="--text-color: var(--ds-gray-1000); --text-size: 1.5rem; --text-line-height: 2rem; --text-letter-spacing: -0.029375rem; --text-weight: 600;">
              <span class="linked-heading_target__xscdv linked-heading_offsetTop__uAoyO"
                id="start-building-today"></span><a class="linked-heading_title__mCMLh [&amp;>p]:m-0"
                href="#start-building-today">Start building today</a><span class="linked-heading_permalink__pJ_q_"><svg
