                    fill="currentColor"></path>
                </svg></span></h3>
          </div>
          <p>Vercel provides tools to build your ideas. We integrate with dozens of <a
              href="https://vercel.com/marketplace" rel="noopener" target="_blank" data-zone="null"
              class="link_link__hbWKh link_blend__JjXMT">popular databases</a>, cloud infrastructure providers like <a
              data-zone="same" class="link_link__hbWKh link_blend__JjXMT" href="/docs/oidc/aws">AWS</a>, and more.</p>
          <p><a href="/new" data-zone="vercel-site" class="link_link__hbWKh link_blend__JjXMT" data-prefetch="true">What
              will you ship?</a></p>
